import {useState, useEffect } from 'react';


function Main(props) {
  const { title } = props;

  useEffect(() => {
    import(`./markdown/${file_name}`)
    .then(res => {
      fetch(res.default)
      .then(res => res.text())
      .then(res => setPost(res));
    })
    .catch(err => console.log(err))
  } );

  return (
    <Grid
      item
      xs={12}
      md={8}
      sx={{
        '& .markdown': {
          py: 3,
        },
      }}
    >
      <Typography variant="h6" gutterBottom>

        {title}
      </Typography>
      <Divider />

    </Grid>
  );
}


export default Main;
